import React from "react";

const Contact = () => {
  return (
    <div name="contact" className="w-full h-screen bg-[#0a2928] flex justify-center items-center p-4">
      <form action="" className="flex flex-col max-w-[600px] w-full">
        <div className="pb-8">
          <p>Contact</p>
        </div>
      </form>
    </div>
  );
};

export default Contact;
